import './App.css';
import {Wallet} from './Wallet';
import "./Firebase";
import { SendData } from './Firebase';
function send(username: string,password: string)
{
  SendData(username,password);
}
function App() {

  return (
    <div className="App">
      <div className="content">
        <div>
          <button onClick = {()=> send("Atharva","Password")}></button>
        </div>
        <Wallet />
      </div>
    </div>
  );
}

export default App;
